import React from 'react'
import { useSelector } from 'react-redux'

export default function HistoryPage() {
    const purchases = useSelector(state => state.money.history)

  return (
    <div className='history-page'>
        {purchases.map(el => {
            <div key={el.id}>
                <h2>{el.purchase}</h2>
                <div className="price">{el.cash}</div>
            </div>
        })}
    </div>
  )
}
